answer= checkUS();
function checkUS(){
	var user = new GlideRecord('sys_user');
	if(user.get(current.user)){
		//var cus = new GlideRecord('x_526535_bookroom_room_reservation');
		if(user.hasRole('x_526535_bookroom.Student')){
			return 'yes';
		}else {
			return 'no';
		}
	}
}

